import './App.css';
import  GetStarted from './components/GetStarted/GetStarted'
import DfindHeader from './components/DfindHeader'
import 'bootstrap/dist/css/bootstrap.min.css';
import CBot from './components/Chatbot/Chatbot';
import { MDBCol } from 'mdb-react-ui-kit';

function App() {
  return (
    <div className="App" class="d-flex align-items-start bg-light mb-3" style={{ height: "100px"}}>
      <DfindHeader/>
      <GetStarted/>
      <CBot/>
    </div>
  );
}

export default App;
